import { action, makeObservable, observable, observe } from "mobx";
import { v4 as uuidv4 } from 'uuid';

interface Card {
  id: string;
  url: string;
  category: string;
}

const urls:string[] = [
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
  'data:image/jpeg;base64,',
];

function createCard(id:string, url:string, category:string):Card {
  return {id, url, category};
}

const cards:Card[] = urls.map((url, index) => createCard(uuidv4(), url, (index < 5 ?'favorite' : index < 10 ? 'new' : 'popular')));

class Content {
  cards = [];
  currentPage = 'favorite';

  constructor(cards) {
    makeObservable(this, {
      cards: observable,
      currentPage: observable,
      addCard: action,
      removeCard: action,
      changeCurrentPage: action,
    });

    this.cards = cards;
  }

  addCard(card) {
    this.cards.push(card);
  }

  removeCard(id) {
    this.cards.filter((card) => id !== card.id);
  }

  changeCurrentPage(currentPage) {
    this.currentPage = currentPage;
  }
}

export const store = new Content(cards);